Question:Develop a Python program that calculates the factorial of a number. The factorial of a positive number N is the product of all positive numbers up to and including N. For example, the factorial of 5 is 1*2*3*4*5 = 120.

Solution:def factorial(n):
    if n == 0:
        return 1
    else:
        return n * factorial(n-1)

