Question:Design a C# function que reciba un string como parámetro y devuelva el número de palabras que tiene ese string. Se debe utilizar un bucle for y el método. Count() de la clase String. Los datos se deben mostrar en pantalla en el orden en que se encuentren en el string. Por ejemplo: Si el string es: "Hola, soy el nombre de este programa" el número de palabras es 9. Si el string es: "Estoy aprendiendo a programar" el número de palabras es 7. Si el string es: "Estoy aprendiendo a programar en Java" el número de palabras es 8.
``` 
public class Palabra {
    public static void main(String[] args) {
        String frase = "Hola, soy el nombre de este programa";
        int palabras = 0;
        for (int i = 0; i < frase.length(); i++) {
            palabras++;
        }
        System.out.println("El número de palabras es: " + palabras);
    }
}
```<|end_of_text|>

