Question:Build a Java application that counts the number of words with more than 3 letras that appear in a given text. The application must count the number of words with more than 3 letras and print the total number of words with this length, along with the total number of words with less than 3 letras and the total number of words with more than 5 letras.
Solution:Here is a possible implementation of this requirement in java:
```java
import java.io.*;
public class CountWords {
    public static void main(String[] args) throws FileNotFoundException {
        //Obtenemos el archivo
        File file = new File("archivo.txt");
        //Leer el archivo
        Scanner scan = new Scanner(file);
        //Contar las palabras que tiene el archivo
        int total = 0;
        while (scan.hasNextLine()) {
            String linea = scan.nextLine();
            //Contar las palabras que tiene el archivo
            total += linea.length();
        }
        //Contar las palabras que tiene el archivo
        System.out.println("Total de palabras: " + total);
    }
}
```<|end_of_text|>

